    def test_current_and_max_week_men_2018(self):
        scraper = Scraper()

        test_json = scraper.get_current_and_max_week(ScraperConstants.Men, 2018)

        self.assertEqual(test_json['week'], "100")
        self.assertEqual(test_json['max'], "13")
    
